INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 1, 0, "", 60000, "カリン", 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 1, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 2, 1, "", 60000, "", 2, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 3, 1, "", 60000, "", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 4, 1, "", 60000, "", 2, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 5, 2, "", 60000, "", 2, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 6, 2, "", 60000, "", 2, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 7, 2, "", 60000, "", 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 8, 3, "", 60000, "", 2, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 9, 3, "", 60000, "", 2, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 10, 3, "", 60000, "", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 11, 3, "", 60000, "", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 12, 3, "", 60000, "", 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 13, 4, "", 60000, "", 2, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 14, 4, "", 60000, "", 2, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 15, 4, "", 60000, "", 2, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 16, 4, "", 60000, "", 2, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 17, 4, "", 60000, "", 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 18, 0, "", 60000, "カリン", 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 2, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 19, 0, "", 60000, "カリン", 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 3, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 20, 0, "", 80001, "ハツネ", 0, 0, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 1, 101201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 21, 0, "", 80001, "ハツネ", 0, 0, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 1, 2, 101201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 22, 0, "", 80001, "シオリ", 1, 0, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 1, 103801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 23, 0, "", 80001, "シオリ", 1, 0, "来年も、\n一緒にいられたら…\nうれしいな", 1, 2, 103801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 24, 0, "", 80001, "キョウカ", 0, 0, "あなたと一緒にいるようになって、\nもう1年ですか…", 2, 1, 103601);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 25, 0, "", 80001, "キョウカ", 0, 0, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 2, 103601);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 26, 0, "", 80001, "ミミ", 1, 0, "おにいちゃんとあってから、\n1年たったよ～！", 2, 1, 102001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 27, 0, "", 80001, "ミミ", 1, 0, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 2, 102001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 28, 0, "", 80001, "ミソギ", 2, 0, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 1, 100401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 29, 0, "", 80001, "ミソギ", 2, 0, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 2, 100401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 30, 0, "", 80001, "マホ", 0, 0, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 3, 1, 101001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 31, 0, "", 80001, "マホ", 0, 0, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 3, 2, 101001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 32, 0, "", 80001, "イリヤ", 1, 0, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 3, 1, 104401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 33, 0, "", 80001, "イリヤ", 1, 0, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 3, 2, 104401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 34, 0, "", 80001, "カオリ", 2, 0, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 3, 1, 101701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 35, 0, "", 80001, "カオリ", 2, 0, "これからも、どうぞよろしく\nお願いするさ～！", 3, 2, 101701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 36, 0, "", 80001, "サレン", 0, 0, "あんたと出会ってからもうそんなに\nたつのね～", 4, 1, 102801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 37, 0, "", 80001, "サレン", 0, 0, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 4, 2, 102801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 38, 0, "", 80001, "スズメ", 1, 0, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 4, 1, 102501);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 39, 0, "", 80001, "スズメ", 1, 0, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 4, 2, 102501);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 40, 0, "", 80001, "タマキ", 0, 0, "振り返れば、今までいろんなことが\nあったにゃあ…", 5, 1, 104601);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 41, 0, "", 80001, "タマキ", 0, 0, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 5, 2, 104601);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 42, 0, "", 80001, "ミフユ", 1, 0, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 5, 1, 104801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 43, 0, "", 80001, "ミフユ", 1, 0, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 5, 2, 104801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 44, 0, "", 80001, "アキノ", 0, 0, "あなたさまと出会ってもう1年…", 6, 1, 103201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 45, 0, "", 80001, "アキノ", 0, 0, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 6, 2, 103201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 46, 0, "", 80001, "ユカリ", 1, 0, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 6, 1, 103401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 47, 0, "", 80001, "ユカリ", 1, 0, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 6, 2, 103401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 48, 0, "", 80001, "クリスティーナ", 0, 0, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 7, 1, 107101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 49, 0, "", 80001, "クリスティーナ", 0, 0, "ともかくこれからも\n愉しませてくれよ☆", 7, 2, 107101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 50, 0, "", 80001, "ジュン", 1, 0, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 7, 1, 104701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 51, 0, "", 80001, "ジュン", 1, 0, "見えないから分からないって？\nそれもそうだな…", 7, 2, 104701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 52, 0, "", 80001, "トモ", 0, 0, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 8, 1, 103701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 53, 0, "", 80001, "トモ", 0, 0, "これからもよろしくね！", 8, 2, 103701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 54, 0, "", 80001, "マツリ", 1, 0, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 8, 1, 100501);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 55, 0, "", 80001, "マツリ", 1, 0, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 8, 2, 100501);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 56, 0, "", 80001, "ミヤコ", 0, 0, "オマエと会って1年なの！\n全然成仏もできなかったし、", 9, 1, 100701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 57, 0, "", 80001, "ミヤコ", 0, 0, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 9, 2, 100701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 58, 0, "", 80001, "シノブ", 1, 0, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 9, 1, 103101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 59, 0, "", 80001, "シノブ", 1, 0, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 9, 2, 103101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 60, 0, "", 80001, "アンナ", 0, 0, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 10, 1, 100901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 61, 0, "", 80001, "アンナ", 0, 0, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 10, 2, 100901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 62, 0, "", 80001, "ナナカ", 1, 0, "君と出会ってもう1年だって！\n早いねー！", 10, 1, 101301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 63, 0, "", 80001, "ナナカ", 1, 0, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 10, 2, 101301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 64, 0, "", 80001, "ミツキ", 0, 0, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 11, 1, 105101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 65, 0, "", 80001, "ミツキ", 0, 0, "これからも、いろんなところを\n調べさせてね？", 11, 2, 105101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 66, 0, "", 80001, "ルカ", 1, 0, "お前さんと出会ってもう1年か\n助太刀するつもりが", 11, 1, 105601);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 67, 0, "", 80001, "ルカ", 1, 0, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 11, 2, 105601);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 68, 0, "", 80001, "エリコ", 2, 0, "早いものですわね、あなた様と\nお会いして、もう1年…", 11, 1, 102701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 69, 0, "", 80001, "エリコ", 2, 0, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 11, 2, 102701);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 70, 0, "", 80001, "アヤネ", 0, 0, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 12, 1, 102301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 71, 0, "", 80001, "アヤネ", 0, 0, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 12, 2, 102301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 72, 0, "", 80001, "チカ", 1, 0, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 12, 1, 104201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 73, 0, "", 80001, "チカ", 1, 0, "私のことを見守ってください\nできることなら、ずっと…", 12, 2, 104201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 74, 0, "", 80001, "クルミ", 2, 0, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 12, 1, 102101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 75, 0, "", 80001, "クルミ", 2, 0, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 12, 2, 102101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 76, 0, "", 80001, "シズル", 0, 0, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 13, 1, 104901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 77, 0, "", 80001, "シズル", 0, 0, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 13, 2, 104901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 78, 0, "", 80001, "リノ", 1, 0, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 13, 1, 101101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 79, 0, "", 80001, "リノ", 1, 0, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 13, 2, 101101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 80, 0, "", 80001, "ユイ", 0, 0, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 14, 1, 100201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 81, 0, "", 80001, "ユイ", 0, 0, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 14, 2, 100201);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 82, 0, "", 80001, "ヒヨリ", 1, 0, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 14, 1, 100101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 83, 0, "", 80001, "ヒヨリ", 1, 0, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 14, 2, 100101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 84, 0, "", 80001, "レイ", 2, 0, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 14, 1, 100301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 85, 0, "", 80001, "レイ", 2, 0, "キミに背中を預けられる日が、\n早くきますように", 14, 2, 100301);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 86, 0, "", 80001, "ペコリーヌ", 0, 0, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 15, 1, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 87, 0, "", 80001, "ペコリーヌ", 0, 0, "これからもずっと、覚えていて\nくださいね！", 15, 2, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 88, 0, "", 80001, "コッコロ", 1, 0, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 15, 1, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 89, 0, "", 80001, "コッコロ", 1, 0, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 15, 2, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 90, 0, "", 80001, "キャル", 2, 0, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 15, 1, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 91, 0, "", 80001, "キャル", 2, 0, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 15, 2, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 92, 0, "", 60001, "スズメ", 1, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 1, 112101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 93, 1, "", 60001, "", 2, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 94, 1, "", 60001, "", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 95, 1, "", 60001, "", 2, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 96, 1, "", 60001, "", 2, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 97, 1, "", 60001, "", 2, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 98, 2, "", 60001, "", 2, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 99, 2, "", 60001, "", 2, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 100, 2, "", 60001, "", 2, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 101, 2, "", 60001, "", 2, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 102, 2, "", 60001, "", 2, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 103, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 104, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 105, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 106, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 107, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 108, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 109, 3, "", 60001, "", 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 110, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 111, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 112, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 113, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 114, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 115, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 116, 4, "", 60001, "", 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 117, 0, "", 60001, "スズメ", 3, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 2, 112101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 118, 0, "", 60001, "スズメ", 3, 0, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 7, 3, 112101);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 119, 0, "", 80003, "ペコリーヌ", 0, 0, "ヒューヒュー♪\nドンドンパフパフー♪", 1, 1, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 120, 0, "", 80003, "コッコロ", 1, 0, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 1, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 121, 0, "", 80003, "コッコロ", 1, 0, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 2, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 122, 0, "", 80003, "キャル", 2, 0, "え？　ちょっと\nいきなりなにっ？", 1, 1, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 123, 0, "", 80003, "キャル", 2, 0, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 1, 2, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 124, 0, "", 80003, "ペコリーヌ", 0, 0, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 1, 2, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 125, 0, "", 80003, "ペコリーヌ", 0, 0, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 1, 3, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 126, 0, "", 80003, "コッコロ", 1, 0, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 3, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 127, 0, "", 80003, "キャル", 2, 0, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 1, 3, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 128, 0, "", 80003, "コッコロ", 1, 0, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 4, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 129, 0, "", 80003, "ペコリーヌ", 0, 0, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 1, 4, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 130, 0, "", 80003, "キャル", 2, 0, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 1, 4, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 131, 0, "", 80003, "コッコロ", 1, 0, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 5, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 132, 0, "", 80003, "キャル", 0, 0, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 2, 5, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 133, 0, "", 80003, "カリン", 1, 0, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 2, 1, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 134, 0, "", 80003, "キャル", 0, 0, "げっ…カリンじゃない\nなんでもないわよ！", 2, 6, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 135, 0, "", 80003, "カリン", 1, 0, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 2, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 136, 0, "", 80003, "キャル", 0, 0, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 2, 7, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 137, 0, "", 80003, "カリン", 1, 0, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 2, 3, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 138, 0, "", 80003, "キャル", 0, 0, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 2, 8, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 139, 0, "", 80003, "キャル", 0, 0, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 2, 9, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 140, 0, "", 80003, "カリン", 1, 0, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 2, 4, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 141, 0, "", 80003, "キャル", 0, 0, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 2, 10, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 142, 0, "", 80003, "カリン", 1, 0, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 2, 5, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 143, 0, "", 80003, "キャル", 0, 0, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 2, 11, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 144, 0, "", 80003, "コッコロ", 0, 0, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 3, 6, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 145, 0, "", 80003, "ペコリーヌ", 1, 0, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 3, 5, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 146, 0, "", 80003, "コッコロ", 0, 0, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 3, 7, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 147, 0, "", 80003, "コッコロ", 0, 0, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 3, 8, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 148, 0, "", 80003, "ペコリーヌ", 1, 0, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 3, 6, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 149, 0, "", 80003, "ペコリーヌ", 1, 0, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 3, 7, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 150, 0, "", 80003, "コッコロ", 0, 0, "あとは、牧場に素敵な温泉が\n出来たとか…", 3, 9, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 151, 0, "", 80003, "ペコリーヌ", 1, 0, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 3, 8, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 152, 0, "", 80003, "コッコロ", 0, 0, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 3, 10, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 153, 0, "", 80003, "ペコリーヌ", 1, 0, "えへへ、ありがとうございます\nコッコロちゃん！", 3, 9, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 154, 0, "", 80003, "コッコロ", 0, 0, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 3, 11, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 155, 0, "", 80003, "ペコリーヌ", 1, 0, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 3, 10, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 156, 0, "", 80003, "ペコリーヌ", 0, 0, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 4, 11, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 157, 0, "", 80003, "キャル", 1, 0, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 4, 12, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 158, 0, "", 80003, "ペコリーヌ", 0, 0, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 4, 12, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 159, 0, "", 80003, "キャル", 1, 0, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 4, 13, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 160, 0, "", 80003, "ペコリーヌ", 0, 0, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 4, 13, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 161, 0, "", 80003, "キャル", 1, 0, "…積極的？\nなんの話よ？", 4, 14, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 162, 0, "", 80003, "ペコリーヌ", 0, 0, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 4, 14, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 163, 0, "", 80003, "ペコリーヌ", 0, 0, "ムーサの町で\nきゃるきゃる～ん☆　って！", 4, 15, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 164, 0, "", 80003, "キャル", 1, 0, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 4, 15, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 165, 0, "", 80003, "ペコリーヌ", 0, 0, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 4, 16, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 166, 0, "", 80003, "キャル", 1, 0, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 4, 16, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 167, 0, "", 80003, "キャル", 1, 0, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 4, 17, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 168, 0, "", 80003, "キャル", 0, 0, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 5, 18, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 169, 0, "", 80003, "コッコロ", 1, 0, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 5, 12, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 170, 0, "", 80003, "キャル", 0, 0, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 5, 19, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 171, 0, "", 80003, "コッコロ", 1, 0, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 5, 13, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 172, 0, "", 80003, "キャル", 0, 0, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 5, 20, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 173, 0, "", 80003, "コッコロ", 1, 0, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 5, 14, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 174, 0, "", 80003, "キャル", 0, 0, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 5, 21, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 175, 0, "", 80003, "コッコロ", 1, 0, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 5, 15, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 176, 0, "", 80003, "キャル", 0, 0, "かくし芸？", 5, 22, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 177, 0, "", 80003, "コッコロ", 1, 0, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 5, 16, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 178, 0, "", 80003, "キャル", 0, 0, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 5, 23, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 179, 0, "", 80003, "ペコリーヌ", 0, 0, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 6, 17, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 180, 0, "", 80003, "キャル", 2, 0, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 6, 24, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 181, 0, "", 80003, "コッコロ", 1, 0, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 6, 17, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 182, 0, "", 80003, "ペコリーヌ", 0, 0, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 6, 18, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 183, 0, "", 80003, "キャル", 2, 0, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 6, 25, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 184, 0, "", 80003, "コッコロ", 1, 0, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 6, 18, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 185, 0, "", 80003, "キャル", 2, 0, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 6, 26, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 186, 0, "", 80003, "キャル", 2, 0, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 6, 27, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 187, 0, "", 80003, "キャル", 2, 0, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 6, 28, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 188, 0, "", 80003, "ペコリーヌ", 0, 0, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 6, 19, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 189, 0, "", 80003, "コッコロ", 1, 0, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 6, 19, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 190, 0, "", 80003, "キャル", 2, 0, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 6, 29, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 191, 0, "", 80003, "キャル", 0, 0, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 7, 30, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 192, 0, "", 80003, "キャル", 0, 0, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 7, 31, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 193, 0, "", 80003, "キャル", 0, 0, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 7, 32, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 194, 0, "", 80003, "キャル", 0, 0, "あー\nあー\n…声、これで大丈夫かしら？", 7, 33, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 195, 0, "", 80003, "キャル", 0, 0, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 7, 34, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 196, 0, "", 80003, "キャル", 0, 0, "オイッスー☆", 7, 35, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 197, 0, "", 80003, "キャル", 0, 0, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 7, 36, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 198, 0, "", 80003, "キャル", 0, 0, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 7, 37, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 199, 0, "", 80003, "キャル", 0, 0, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 7, 38, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 200, 0, "", 80003, "コッコロ", 0, 0, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 8, 20, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 201, 0, "", 80003, "コッコロ", 0, 0, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 8, 21, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 202, 0, "", 80003, "コッコロ", 0, 0, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 8, 22, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 203, 0, "", 80003, "コッコロ", 0, 0, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 8, 23, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 204, 0, "", 80003, "コッコロ", 0, 0, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 8, 24, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 205, 0, "", 80003, "コッコロ", 0, 0, "オイッスー☆", 8, 25, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 206, 0, "", 80003, "コッコロ", 0, 0, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 8, 26, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 207, 0, "", 80003, "コッコロ", 0, 0, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 8, 27, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 208, 0, "", 80003, "コッコロ", 0, 0, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 8, 28, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 209, 0, "", 80003, "ペコリーヌ", 0, 0, "オイッスー☆", 9, 20, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 210, 0, "", 80003, "ペコリーヌ", 0, 0, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 9, 21, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 211, 0, "", 80003, "ペコリーヌ", 0, 0, "あと６日で2.5周年ですか…", 9, 22, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 212, 0, "", 80003, "ペコリーヌ", 0, 0, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 9, 23, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 213, 0, "", 80003, "ペコリーヌ", 0, 0, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 9, 24, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 214, 0, "", 80003, "ペコリーヌ", 0, 0, "オイッスー☆", 9, 25, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 215, 0, "", 80003, "ペコリーヌ", 0, 0, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 9, 26, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 216, 0, "", 80003, "ペコリーヌ", 0, 0, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 9, 27, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 217, 0, "", 80003, "ペコリーヌ", 0, 0, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 9, 28, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 218, 0, "", 80003, "ペコリーヌ", 0, 0, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 9, 29, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 219, 0, "", 80003, "ペコリーヌ", 0, 0, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 9, 30, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 220, 0, "", 80003, "ペコリーヌ", 0, 0, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 10, 31, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 221, 0, "", 80003, "コッコロ", 1, 0, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 10, 29, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 222, 0, "", 80003, "ペコリーヌ", 0, 0, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 10, 32, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 223, 0, "", 80003, "キャル", 2, 0, "…………", 10, 39, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 224, 0, "", 80003, "コッコロ", 1, 0, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 10, 30, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 225, 0, "", 80003, "キャル", 2, 0, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 10, 40, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 226, 0, "", 80003, "ペコリーヌ", 0, 0, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 10, 33, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 227, 0, "", 80003, "キャル", 2, 0, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 10, 41, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 228, 0, "", 80003, "ペコリーヌ", 0, 0, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 10, 34, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 229, 0, "", 80003, "ペコリーヌ", 0, 0, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 10, 35, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 230, 0, "", 80003, "キャル", 2, 0, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 10, 42, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 231, 0, "", 80003, "コッコロ", 1, 0, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 10, 31, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 232, 0, "", 80003, "キャル", 2, 0, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 10, 43, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 233, 0, "", 80003, "ペコリーヌ", 0, 0, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 10, 36, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 234, 0, "", 80003, "カリン", 0, 0, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 11, 6, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 235, 0, "", 80003, "カリン", 0, 0, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 11, 7, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 236, 0, "", 80003, "カリン", 0, 0, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 11, 8, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 237, 0, "", 80003, "カリン", 0, 0, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 11, 9, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 238, 0, "", 80003, "カリン", 0, 0, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 11, 10, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 239, 0, "", 80003, "カリン", 0, 0, "次にコッコロさんですが\nこちらは発声練習をしています", 11, 11, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 240, 0, "", 80003, "カリン", 0, 0, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 11, 12, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 241, 0, "", 80003, "カリン", 0, 0, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 11, 13, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 242, 0, "", 80003, "カリン", 0, 0, "あれ？\nもしかして緊張で気を失って…？", 11, 14, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 243, 0, "", 80003, "カリン", 0, 0, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 11, 15, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 244, 0, "", 80003, "カリン", 0, 0, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 11, 16, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 245, 0, "", 80003, "カリン", 0, 0, "それでは\nまた明日お会いしましょう♪", 11, 17, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 246, 0, "", 80003, "キャル", 0, 0, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 12, 44, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 247, 0, "", 80003, "ペコリーヌ", 2, 0, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 12, 37, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 248, 0, "", 80003, "コッコロ", 1, 0, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 12, 32, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 249, 0, "", 80003, "キャル", 0, 0, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 12, 45, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 250, 0, "", 80003, "ペコリーヌ", 2, 0, "ひどいですよぉキャルちゃ～ん！", 12, 38, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 251, 0, "", 80003, "コッコロ", 1, 0, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 12, 33, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 252, 0, "", 80003, "ペコリーヌ", 2, 0, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 12, 39, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 253, 0, "", 80003, "キャル", 0, 0, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 12, 46, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 254, 0, "", 80003, "コッコロ", 1, 0, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 12, 34, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 255, 0, "", 80003, "ペコリーヌ", 2, 0, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 12, 40, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 256, 0, "", 80003, "ペコリーヌ", 0, 0, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 13, 41, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 257, 0, "", 80003, "キャル", 2, 0, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 13, 47, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 258, 0, "", 80003, "ペコリーヌ", 0, 0, "忘れてきちゃいました☆", 13, 42, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 259, 0, "", 80003, "キャル", 2, 0, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 13, 48, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 260, 0, "", 80003, "コッコロ", 1, 0, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 13, 35, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 261, 0, "", 80003, "キャル", 2, 0, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 13, 49, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 262, 0, "", 80003, "ペコリーヌ", 0, 0, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 13, 43, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 263, 0, "", 80003, "キャル", 2, 0, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 13, 50, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 264, 0, "", 80003, "コッコロ", 1, 0, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 13, 36, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 265, 0, "", 80003, "キャル", 2, 0, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 13, 51, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 266, 0, "", 80003, "コッコロ", 1, 0, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 13, 37, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 267, 0, "", 80003, "キャル", 2, 0, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 13, 52, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 268, 0, "", 80003, "ペコリーヌ", 0, 0, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 13, 44, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 269, 0, "", 80003, "コッコロ", 1, 0, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 13, 38, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 270, 0, "", 80003, "ペコリーヌ", 0, 0, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 13, 45, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 271, 0, "", 80003, "キャル", 2, 0, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 13, 53, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 272, 0, "", 80003, "ペコリーヌ", 0, 0, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 13, 46, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 273, 0, "", 80003, "カリン", 0, 0, "こんにちは\n【ギルド管理協会】のカリンです", 14, 18, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 274, 0, "", 80003, "カリン", 0, 0, "昨日の生放送は\nいかがだったでしょうか？", 14, 19, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 275, 0, "", 80003, "カリン", 0, 0, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 14, 20, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 276, 0, "", 80003, "カリン", 0, 0, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 14, 21, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 277, 0, "", 80003, "カリン", 0, 0, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 14, 22, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 278, 0, "", 80003, "カリン", 0, 0, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 14, 23, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 279, 0, "", 80003, "カリン", 0, 0, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 14, 24, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 280, 0, "", 80003, "カリン", 0, 0, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 14, 25, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 281, 0, "", 80003, "カリン", 0, 0, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 14, 26, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 282, 0, "", 80003, "カリン", 0, 0, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 14, 27, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 283, 0, "", 80003, "ペコリーヌ", 0, 0, "準備はいいですかっ？\n…いっきますよー！", 15, 47, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 284, 0, "", 80003, "キャル", 2, 0, "祝！", 15, 54, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 285, 0, "", 80003, "コッコロ", 1, 0, "2.5周年！", 15, 39, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 286, 0, "", 80003, "ペコリーヌ", 0, 0, "おめでとうございま～す☆", 15, 48, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 287, 0, "", 80003, "キャル", 2, 0, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 15, 55, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 288, 0, "", 80003, "コッコロ", 1, 0, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 15, 40, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 289, 0, "", 80003, "ペコリーヌ", 0, 0, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 15, 49, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 290, 0, "", 80003, "キャル", 2, 0, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 15, 56, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 291, 0, "", 80003, "コッコロ", 1, 0, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 15, 41, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 292, 0, "", 80003, "キャル", 2, 0, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 15, 57, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 293, 0, "", 80003, "ペコリーヌ", 0, 0, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 15, 50, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 294, 0, "", 80003, "キャル", 2, 0, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 15, 58, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 295, 0, "", 80003, "ペコリーヌ", 0, 0, "記念日だから\n平気平気♪\nやばいですね☆", 15, 51, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 296, 0, "", 80003, "キャル", 2, 0, "意味分かんないわよ！", 15, 59, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 297, 0, "", 80003, "コッコロ", 1, 0, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 15, 42, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 298, 0, "", 80003, "コッコロ", 1, 0, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 15, 43, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 299, 0, "", 80003, "ペコリーヌ", 0, 0, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 15, 52, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 300, 0, "", 80003, "キャル", 2, 0, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 15, 60, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 301, 0, "", 80003, "コッコロ", 1, 0, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 15, 44, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 302, 0, "", 80003, "ペコリーヌ", 0, 0, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 15, 53, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 303, 0, "105901,45,106001,61", 80003, "ペコリーヌ・コッコロ・キャル", 0, 1, "2.5周年\nありがとうございます！", 15, 54, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 304, 0, "", 60002, "カリン", 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 1, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 305, 1, "", 60002, "", 2, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 306, 1, "", 60002, "", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 307, 1, "", 60002, "", 2, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 308, 1, "", 60002, "", 2, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 309, 1, "", 60002, "", 2, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 310, 2, "", 60002, "", 2, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 311, 2, "", 60002, "", 2, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 312, 2, "", 60002, "", 2, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 313, 2, "", 60002, "", 2, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 314, 2, "", 60002, "", 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 315, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 316, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 317, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 318, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 319, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 320, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 321, 3, "", 60002, "", 2, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 322, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 323, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 324, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 325, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 326, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 327, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 328, 4, "", 60002, "", 2, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 329, 0, "", 60002, "カリン", 3, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 2, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 330, 0, "", 60002, "カリン", 3, 0, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 7, 3, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 331, 0, "", 80005, "コッコロ", 4, 0, "ささ、シェフィさまはこちらへ…", 1, 1, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 332, 0, "", 80005, "シェフィ", 0, 0, "コッコロさん、どこへ行くの…？\n…え？", 1, 1, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 333, 0, "", 80005, "ペコリーヌ", 3, 0, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 1, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 334, 0, "", 80005, "コッコロ", 4, 0, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 1, 2, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 335, 0, "", 80005, "シェフィ", 0, 0, "ええと…\n二人とも何をしているの？", 1, 2, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 336, 0, "", 80005, "キャル", 1, 0, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 1, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 337, 0, "", 80005, "シェフィ", 0, 0, "あの日…？", 1, 3, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 338, 0, "", 80005, "ペコリーヌ", 3, 0, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 1, 2, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 339, 0, "", 80005, "ペコリーヌ", 3, 0, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 1, 3, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 340, 0, "", 80005, "カリン", 2, 0, "やばいですね☆", 1, 1, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 341, 0, "", 80005, "キャル", 1, 0, "って、なにしれっと\n参加してんのよカリン！", 1, 2, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 342, 0, "", 80005, "カリン", 2, 0, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 1, 2, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 343, 0, "", 80005, "カリン", 2, 0, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 1, 3, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 344, 0, "", 80005, "ペコリーヌ", 3, 0, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 1, 4, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 345, 0, "", 80005, "シェフィ", 0, 0, "えっ！？　ええとええと…！\nあ、あと14日…！", 1, 4, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 346, 0, "", 80005, "ペコリーヌ", 3, 0, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 2, 5, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 347, 0, "", 80005, "コッコロ", 1, 0, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 2, 3, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 348, 0, "", 80005, "コッコロ", 1, 0, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 2, 4, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 349, 0, "", 80005, "ペコリーヌ", 3, 0, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 2, 6, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 350, 0, "", 80005, "コッコロ", 1, 0, "さすがでございます\nペコリーヌさま", 2, 5, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 351, 0, "", 80005, "キャル", 0, 0, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 2, 3, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 352, 0, "", 80005, "シェフィ", 2, 0, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 5, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 353, 0, "", 80005, "ペコリーヌ", 3, 0, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 2, 7, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 354, 0, "", 80005, "コッコロ", 1, 0, "さ、次はキャルさまの\n番でございますよ", 2, 6, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 355, 0, "", 80005, "キャル", 0, 0, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 2, 4, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 356, 0, "", 80005, "シェフィ", 2, 0, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 6, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 357, 0, "", 80005, "キャル", 0, 0, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 2, 5, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 358, 0, "", 80005, "キャル", 0, 0, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 2, 6, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 359, 0, "", 80005, "コッコロ", 1, 0, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 2, 7, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 360, 0, "", 80005, "キャル", 0, 0, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 2, 7, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 361, 0, "", 80005, "コッコロ", 1, 0, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 3, 8, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 362, 0, "", 80005, "ペコリーヌ", 3, 0, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 8, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 363, 0, "", 80005, "コッコロ", 1, 0, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 3, 9, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 364, 0, "", 80005, "シェフィ", 2, 0, "聖学祭…って、なにかしら？", 3, 7, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 365, 0, "", 80005, "コッコロ", 1, 0, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 3, 10, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 366, 0, "", 80005, "キャル", 0, 0, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 3, 8, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 367, 0, "", 80005, "キャル", 0, 0, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 3, 9, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 368, 0, "", 80005, "ペコリーヌ", 3, 0, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 9, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 369, 0, "", 80005, "キャル", 0, 0, "いや、そのまんますぎでしょ…", 3, 10, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 370, 0, "", 80005, "シェフィ", 2, 0, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 3, 8, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 371, 0, "", 80005, "ペコリーヌ", 3, 0, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 10, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 372, 0, "", 80005, "シェフィ", 2, 0, "えっ？　ええ…\nぎゅーっ…？", 3, 9, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 373, 0, "", 80005, "キャル", 0, 0, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 4, 11, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 374, 0, "", 80005, "シェフィ", 2, 0, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 4, 10, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 375, 0, "", 80005, "キャル", 0, 0, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 4, 12, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 376, 0, "", 80005, "コッコロ", 1, 0, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 4, 11, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 377, 0, "", 80005, "キャル", 0, 0, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 4, 13, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 378, 0, "", 80005, "ペコリーヌ", 3, 0, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 4, 11, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 379, 0, "", 80005, "キャル", 0, 0, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 4, 14, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 380, 0, "", 80005, "キャル", 0, 0, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 4, 15, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 381, 0, "", 80005, "シェフィ", 2, 0, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 4, 11, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 382, 0, "", 80005, "ペコリーヌ", 3, 0, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 4, 12, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 383, 0, "", 80005, "コッコロ", 1, 0, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 4, 12, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 384, 0, "", 80005, "キャル", 0, 0, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 4, 16, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 385, 0, "", 80005, "シェフィ", 2, 0, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 4, 12, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 386, 0, "", 80005, "ペコリーヌ", 3, 0, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 5, 13, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 387, 0, "", 80005, "ペコリーヌ", 3, 0, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 5, 14, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 388, 0, "", 80005, "ペコリーヌ", 3, 0, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 5, 15, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 389, 0, "", 80005, "キャル", 0, 0, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 5, 17, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 390, 0, "", 80005, "キャル", 0, 0, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 5, 18, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 391, 0, "", 80005, "シェフィ", 2, 0, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 5, 13, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 392, 0, "", 80005, "コッコロ", 1, 0, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 5, 13, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 393, 0, "", 80005, "ペコリーヌ", 3, 0, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 5, 16, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 394, 0, "", 80005, "キャル", 0, 0, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 5, 19, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 395, 0, "", 80005, "ペコリーヌ", 3, 0, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 5, 17, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 396, 0, "", 80005, "ペコリーヌ", 3, 0, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 5, 18, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 397, 0, "", 80005, "ペコリーヌ", 3, 0, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 5, 19, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 398, 0, "", 80005, "カリン", 2, 0, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 6, 4, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 399, 0, "", 80005, "カリン", 2, 0, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 6, 5, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 400, 0, "", 80005, "キャル", 1, 0, "…えっ！？", 6, 20, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 401, 0, "", 80005, "ペコリーヌ", 3, 0, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 6, 20, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 402, 0, "", 80005, "シェフィ", 0, 0, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 6, 14, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 403, 0, "", 80005, "コッコロ", 4, 0, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 6, 14, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 404, 0, "", 80005, "シェフィ", 0, 0, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 6, 15, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 405, 0, "", 80005, "キャル", 1, 0, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 6, 21, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 406, 0, "", 80005, "ペコリーヌ", 3, 0, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 6, 21, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 407, 0, "", 80005, "キャル", 1, 0, "ぶっ殺すぞ！？", 6, 22, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 408, 0, "", 80005, "カリン", 2, 0, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 6, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 409, 0, "", 80005, "コッコロ", 1, 0, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 7, 15, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 410, 0, "", 80005, "キャル", 0, 0, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 7, 23, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 411, 0, "", 80005, "シェフィ", 2, 0, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 7, 16, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 412, 0, "", 80005, "ペコリーヌ", 3, 0, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 7, 22, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 413, 0, "", 80005, "キャル", 0, 0, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 7, 24, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 414, 0, "", 80005, "シェフィ", 2, 0, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 7, 17, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 415, 0, "", 80005, "コッコロ", 1, 0, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 7, 16, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 416, 0, "", 80005, "シェフィ", 2, 0, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 7, 18, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 417, 0, "", 80005, "コッコロ", 1, 0, "もちろんでございます\n仲良くお勉強いたしましょう", 7, 17, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 418, 0, "", 80005, "キャル", 0, 0, "しれっと教育ママが\n生まれてる…？", 7, 25, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 419, 0, "", 80005, "ペコリーヌ", 3, 0, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 7, 23, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 420, 0, "", 80005, "キャル", 0, 0, "え～～～～！？", 7, 26, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 421, 0, "", 80005, "キャル", 0, 0, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 8, 27, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 422, 0, "", 80005, "シェフィ", 2, 0, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 8, 19, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 423, 0, "", 80005, "コッコロ", 1, 0, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 8, 18, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 424, 0, "", 80005, "ペコリーヌ", 3, 0, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 8, 24, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 425, 0, "", 80005, "シェフィ", 2, 0, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 8, 20, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 426, 0, "", 80005, "キャル", 0, 0, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 8, 28, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 427, 0, "", 80005, "コッコロ", 1, 0, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 8, 19, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 428, 0, "", 80005, "シェフィ", 2, 0, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 8, 21, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 429, 0, "", 80005, "キャル", 0, 0, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 8, 29, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 430, 0, "", 80005, "キャル", 0, 0, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 8, 30, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 431, 0, "", 80005, "ペコリーヌ", 3, 0, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 8, 25, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 432, 0, "", 80005, "キャル", 0, 0, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 8, 31, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 433, 0, "", 80005, "シェフィ", 0, 0, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 9, 22, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 434, 0, "", 80005, "シェフィ", 0, 0, "…えっ？\n生放送の意気込み！？\n突然なに！？", 9, 23, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 435, 0, "", 80005, "シェフィ", 0, 0, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 9, 24, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 436, 0, "", 80005, "シェフィ", 0, 0, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 9, 25, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 437, 0, "", 80005, "シェフィ", 0, 0, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 9, 26, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 438, 0, "", 80005, "シェフィ", 0, 0, "それから、それから…！\nぅ、ぅぅっ…！", 9, 27, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 439, 0, "", 80005, "シェフィ", 0, 0, "―びえぇぇ～んっ！！！", 9, 28, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 440, 0, "", 80005, "コッコロ", 1, 0, "どうされましたか、シェフィさま", 9, 20, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 441, 0, "", 80005, "シェフィ", 0, 0, "ううっ…ひっく…\nママッ…！", 9, 29, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 442, 0, "", 80005, "コッコロ", 1, 0, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 9, 21, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 443, 0, "", 80005, "コッコロ", 1, 0, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 9, 22, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 444, 0, "", 80005, "シェフィ", 0, 0, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 9, 30, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 445, 0, "", 80005, "コッコロ", 0, 0, "主さま\n3.5周年まであと５日\nでございます", 10, 23, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 446, 0, "", 80005, "コッコロ", 0, 0, "ですがその前に\n生放送がありますね", 10, 24, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 447, 0, "", 80005, "コッコロ", 0, 0, "…生放送に向けた\n意気込みでございますか？", 10, 25, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 448, 0, "", 80005, "コッコロ", 0, 0, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 10, 26, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 449, 0, "", 80005, "コッコロ", 0, 0, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 10, 27, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 450, 0, "", 80005, "コッコロ", 0, 0, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 10, 28, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 451, 0, "", 80005, "コッコロ", 0, 0, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 10, 29, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 452, 0, "", 80005, "コッコロ", 0, 0, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 10, 30, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 453, 0, "", 80005, "コッコロ", 0, 0, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 10, 31, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 454, 0, "", 80005, "ペコリーヌ", 0, 0, "3.5周年まであと４日！\nやばいですね☆", 11, 26, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 455, 0, "", 80005, "キャル", 1, 0, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 11, 32, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 456, 0, "", 80005, "ペコリーヌ", 0, 0, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 11, 27, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 457, 0, "", 80005, "ペコリーヌ", 0, 0, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 11, 28, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 458, 0, "", 80005, "ペコリーヌ", 0, 0, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 11, 29, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 459, 0, "", 80005, "キャル", 1, 0, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 11, 33, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 460, 0, "", 80005, "ペコリーヌ", 0, 0, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 11, 30, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 461, 0, "", 80005, "ペコリーヌ", 0, 0, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 11, 31, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 462, 0, "", 80005, "ペコリーヌ", 0, 0, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 11, 32, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 463, 0, "", 80005, "キャル", 1, 0, "だからあたしはやるなんて一言も…", 11, 34, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 464, 0, "", 80005, "ペコリーヌ", 0, 0, "オイッスー☆", 11, 33, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 465, 0, "", 80005, "キャル", 1, 0, "聞きなさいっての！！", 11, 35, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 466, 0, "", 80005, "シェフィ", 2, 0, "3.5周年まであと３日…\nそして生放送は、明日…", 12, 31, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 467, 0, "", 80005, "シェフィ", 2, 0, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 12, 32, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 468, 0, "", 80005, "シェフィ", 2, 0, "おいっす！\n…こうじゃなかったわね\nええと確か…", 12, 33, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 469, 0, "", 80005, "シェフィ", 2, 0, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 12, 34, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 470, 0, "", 80005, "シェフィ", 2, 0, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 12, 35, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 471, 0, "", 80005, "ペコリーヌ", 3, 0, "やってますねシェフィちゃん！", 12, 34, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 472, 0, "", 80005, "キャル", 0, 0, "なによ、考えることは\nみんな同じってこと？", 12, 36, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 473, 0, "", 80005, "コッコロ", 1, 0, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 12, 32, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 474, 0, "", 80005, "シェフィ", 2, 0, "みんな…もちろんよ！", 12, 36, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 475, 0, "", 80005, "ペコリーヌ", 3, 0, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 12, 35, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 476, 0, "", 80005, "カリン", 2, 0, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 13, 7, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 477, 0, "", 80005, "カリン", 2, 0, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 13, 8, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 478, 0, "", 80005, "ペコリーヌ", 3, 0, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 13, 36, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 479, 0, "", 80005, "カリン", 2, 0, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 13, 9, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 480, 0, "", 80005, "コッコロ", 4, 0, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 13, 33, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 481, 0, "", 80005, "カリン", 2, 0, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 13, 10, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 482, 0, "", 80005, "キャル", 1, 0, "大丈夫…大丈夫…\nあたしは大丈夫…", 13, 37, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 483, 0, "", 80005, "カリン", 2, 0, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 13, 11, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 484, 0, "", 80005, "シェフィ", 0, 0, "あうー？", 13, 37, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 485, 0, "105901,34,106001,38,190801,12", 80005, "みんな", 4, 1, "あ…", 13, 37, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 486, 0, "", 80005, "キャル", 1, 0, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 13, 39, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 487, 0, "", 80005, "コッコロ", 4, 0, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 13, 35, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 488, 0, "", 80005, "ペコリーヌ", 3, 0, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 13, 38, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 489, 0, "", 80005, "カリン", 2, 0, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 13, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 490, 0, "", 80005, "シェフィ", 2, 0, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 14, 38, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 491, 0, "", 80005, "ペコリーヌ", 3, 0, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 14, 39, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 492, 0, "", 80005, "キャル", 0, 0, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 14, 40, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 493, 0, "", 80005, "コッコロ", 1, 0, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 14, 36, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 494, 0, "", 80005, "シェフィ", 2, 0, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 14, 39, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 495, 0, "", 80005, "ペコリーヌ", 3, 0, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 14, 40, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 496, 0, "", 80005, "コッコロ", 1, 0, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 14, 37, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 497, 0, "", 80005, "キャル", 0, 0, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 14, 41, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 498, 0, "", 80005, "シェフィ", 2, 0, "へ、へぇ…", 14, 40, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 499, 0, "", 80005, "ペコリーヌ", 3, 0, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 14, 41, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 500, 0, "", 80005, "シェフィ", 2, 0, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 14, 41, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 501, 0, "", 80005, "シェフィ", 2, 0, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 14, 42, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 502, 0, "", 80005, "ペコリーヌ", 3, 0, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 15, 42, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 503, 0, "", 80005, "キャル", 1, 0, "祝！", 15, 42, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 504, 0, "", 80005, "コッコロ", 4, 0, "3.5周年！", 15, 38, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 505, 0, "", 80005, "シェフィ", 0, 0, "おめでとうございます！", 15, 43, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 506, 0, "", 80005, "カリン", 2, 0, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 15, 14, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 507, 0, "", 80005, "カリン", 2, 0, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 15, 190801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 508, 0, "", 80005, "ペコリーヌ", 3, 0, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 15, 43, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 509, 0, "", 80005, "ペコリーヌ", 3, 0, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 15, 44, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 510, 0, "", 80005, "キャル", 1, 0, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 15, 43, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 511, 0, "", 80005, "キャル", 1, 0, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 15, 44, 106001);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 512, 0, "", 80005, "シェフィ", 0, 0, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 15, 44, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 513, 0, "", 80005, "シェフィ", 0, 0, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 15, 45, 106401);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 514, 0, "", 80005, "コッコロ", 4, 0, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 15, 39, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 515, 0, "", 80005, "コッコロ", 4, 0, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 15, 40, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 516, 0, "", 80005, "コッコロ", 4, 0, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 15, 41, 105901);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 517, 0, "", 80005, "ペコリーヌ", 3, 0, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 15, 45, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (0, 518, 0, "105901,42,106001,45,106401,46,190801,16", 80005, "みんな", 4, 1, "これからも\nよろしくおねがいします！", 15, 46, 105801);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 519, 0, "", 60003, "カリン", 1, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 1, 190804);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 520, 1, "", 60003, "", 2, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 521, 1, "", 60003, "", 2, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 522, 1, "", 60003, "", 2, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 523, 1, "", 60003, "", 2, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 524, 1, "", 60003, "", 2, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 525, 2, "", 60003, "", 2, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 526, 2, "", 60003, "", 2, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 527, 2, "", 60003, "", 2, 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 528, 2, "", 60003, "", 2, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 529, 2, "", 60003, "", 2, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 530, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 531, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 532, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 533, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 534, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 535, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (2, 536, 3, "", 60003, "", 2, 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0, 0);
INSERT INTO `v1_51740ed02d5c29173d7a268113c76045fde32c8f44817c09b48d544e535e5246` VALUES (1, 537, 4, "", 60003, "", 2, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 0);
